import React from 'react';
import PropTypes from 'prop-types';
// import Potato from './Potato';
//./Potato 라는건 App.js와 같은 dir안에 있는 파일이란 뜻

//단어 선택 후 command+D 하면 페이지 내에 있는 모든 그 단어를 수정할 수 있음
const foodILike = [
  {
    id: 1,
    name: "클로티드 크림",
    rating: 1,
    image: "data:image/jpeg;base64,"
  },
  {
    id: 2,
    name: "오렌지 마멀레이드",
    rating: 3,
    image: "data:image/jpeg;base64,"
  },
  {
    id: 3,
    name: "올리브 오일",
    rating: 4,
    image: "data:image/jpeg;base64,"
  },
  {

    id: 4,
    name: "피넛 버터",
    rating: 2,
    image: "data:image/jpeg;base64,"
  },
  {
    id: 5,
    name: "바질페스토",
    rating: 5,
    image: "data:image/jpeg;base64,"
  },
]; 

//Props function for Validation props Type 
Food.prototype ={
  //내가 App2.js에서 <Food key={props.id} /> 로 써놓고 function name({identi}) 처럼 했을 때, props 명 잘못썼다고 알려주는 기능
  name:PropTypes.string.isRequired,
  image:PropTypes.string,
  rating:PropTypes.number.isRequired
}

// foodILike 라는 배열const에는 key와 value들이 있다.
function Food({name, image, rating}) {
  /**
   * function Food(props) 로 args를 설정했다면, 펑션 내에서 {props.name}, {props.fav} 이렇게 변수를 사용할 수 있고,
   * function Food({name, image}) 로 arge를 설정했다면, 그대로 {name}, {image} 로 접근해서 사용가능하다.
   * 단 {} 로 변수명을 감싸주어야 함.
   */
  return (
    <div>
      <h2>마쉰는 {name}🐷({rating}/5)</h2>
      <img src={image} alt={name} /> 
      {/* alt는 시각장애인을 위한 이미지 설명같은 것 */}
    </div>
  )  
}

function renderFood(eachItem) {
  /**
   * renderFood 라는 펑션은 eachItem라는 아이템을 Food 컴포넌트에 props로 넘겨서 return 해주는 펑션
   */
  return <Food key={eachItem.id} name={eachItem.name} image={eachItem.image}/>
}

// function component라고 부른다
function App2() { 
  return (
    <div>
      <h1>hello world</h1>
      {/* <Potato /> */}
      {/* <Food
        fav="빵" 
        kind={["호밀빵"], "바게뜨", 4} 
      />  */}
      
      {/* eachItem is just an element!!!! */}
      {/* map은 각 아이템별로(eachItem) function(여기서는 Food 컴포넌트 func)을 호출(=>) 하라 */}
      
      {foodILike.map(eachItem => <Food key={eachItem.id} rating={eachItem.rating} name={eachItem.name} image={eachItem.image} />)}

      {/* eachItem => 대신 아래의 renderFood 로 함수화 하여 호출 */}
      {foodILike.map(renderFood)}
      
    </div>
  )
}


export default App2;
